import Nam1 from "./image/anh1.jpg";
import Nam2 from "./image/anh2.jpg";

function App() {
  return (
    <div className="w-full flex justify-center bg-red-300">
      <div className=" sm:w-[500px] w-full flex  flex-col items-center space-y-4  ">
        {/* Hiển thị ảnh 1 */}
        <Anh1 />
        {/* Hiển thị ảnh 2 */}
        <Anh2 />
      </div>
    </div>
  );
}

const Anh1 = () => {
  return (
    <div
      className="bg-no-repeat bg-center bg-cover"
      style={{
        backgroundImage: `url(${Nam1})`,
        width: "100%", // Chiều rộng tối đa theo ảnh
        height: 1000, // Điều chỉnh chiều cao tùy ý (có thể thay bằng auto)
      }}
    ></div>
  );
};

const Anh2 = () => {
  return (
    <div
      className="bg-center bg-cover bg-cover"
      style={{
        backgroundImage: `url(${Nam2})`,
        width: "100%", // Điều chỉnh chiều rộng theo ý muốn
        height: "200px", // Điều chỉnh chiều cao
      }}
    ></div>
  );
};

export default App;
